import React,{useState} from "react";


function NewPlayerForm (){
    const [inputValue,setInputValue] = useState(initialPlayer)
    const initialPlayer = {
        rank:"",
        name:"",
        points:"",
        tournamants:"",
        wins:"",
        losses:"",
        image:""
        }

 
    





    return(
        <div>
            <form>
                <input type ="text" name="rank" placeholder="Rank number" value={inputValue.rank}/><br/>    
                <input type ="text" name="name" placeholder="Name" value={inputValue.name}/><br/> 
                <input type ="text" name="points" placeholder="Points" value={inputValue.points}/><br/> 
                <input type ="text" name="tournaments" placeholder="Tournament number" value={inputValue.tournamants}/><br/> 
                <input type ="text" name="wins" placeholder="win total" value={inputValue.wins}/><br/> 
                <input type ="text" name="losses" placeholder="loss total" value={inputValue.losses}/><br/> 
                <input type ="text" name="image" placeholder="Image URL" value={inputValue.image}/><br/> 
                <input type ="submit"/>
            </form>
        </div>
    )
}

export default NewPlayerForm;
